import * as ActionTypes from "./Types";

const onErrors = (type, payload) => {
  let action;
  switch (type) {
    case ActionTypes.NO_ERRORS:
      result = {
        type: ActionTypes.NO_ERRORS,
        payload,
      };
      break;
    case ActionTypes.GET_ERRORS:
      result = {
        type: ActionTypes.GET_ERRORS,
        payload,
      };
      break;
    default:
      break;
  }
  return action;
};

export default onErrors;
